import React from 'react'
import { NavLink } from 'react-router-dom';
import './styles/sidebar.css';
export default function Dashboard({lists,selectedList}) {
    console.log(selectedList)
    return (
        <ul>
            <div id='list-sidebar'>
            <h2>Lists</h2>
            <NavLink to={`/today`} activeClassName="active-link" className='link'>today</NavLink>
            <div>
            { 
                lists.map((l) => 
                    <NavLink to={`/todo-list/${l.id}`} {...selectedList(l)} key={l.id} activeClassName="active-link" className='link'>{l.title} </NavLink>
                )
            }
            </div>
        </div>        
        </ul>
    )
}
